import React from "react";
import Cookies from 'js-cookie';
import './Nav.css';
import * as f from './_functions.js';

class PageSwitch extends React.Component {
    constructor(page) {

        super(page);

        this.page = page || "front";
        this.switchPage = this.switchPage.bind(this);

    }
    switchPage() {
        f.showPage(this.page);
    }

    render() {
        return false;
    }
}
function NavOption({name, page}){
    this.switchPage = function() {
        f.showPage(this.page);
    };
    
        return(
            <li class="nav-item">
                <a class="nav-link" onclick={this.switchPage} href="">{name}<span class="sr-only">(current)</span></a>
            </li>
        );

}
